#define ID_BTN0      2
#define ID_BTN1      3
void userInit(void)
{
    win0=ldWindowInit(0, 0, 0,0,LD_CFG_SCEEN_WIDTH,LD_CFG_SCEEN_HEIGHT);
    ldWindowSetBgColor(win0,__RGB(255,255,255));
    img0=ldImageInit(1, 0, 20,20,72,72,(uint32_t)&press[0],false);
    ldImageSetOpacity(img0,128);
    
    
    
    btn0=ldButtonInit(ID_BTN0, 0, 20,100,72,72);



    btn1=ldButtonInit(ID_BTN1, 0, 120,100,72,72);
//    ldBaseSetTextInfo(btn1,,GLCD_COLOR_RED,64);

    ldButtonSetFont(btn1,&ARM_2D_FONT_6x8.use_as__arm_2d_font_t);
    ldButtonSetText(btn1,"123");
    ldButtonSetTextColor(btn1,GLCD_COLOR_RED);

    //    ldBaseSetText("btn1");

//    ldButtonSetImage(ldGetWidgetById(ID_BTN0),(uint32_t)&release[0],(uint32_t)&press[0],false);

//    ldButtonSetSelectImage(ldGetWidgetById(ID_BTN0),(uint32_t)&select[0],__RGB(255,0,0));

    targetBtn=btn1;
    btn1->isSelected=true;
}

void userInit1(void)
{
    win1=ldWindowInit(0, 0, 0,0,LD_CFG_SCEEN_WIDTH,LD_CFG_SCEEN_HEIGHT);
    img1=ldImageInit(1, 0, 100,120,163,65,(uint32_t)&press[0],false);
}

void userLoop(void)
{
//    if( ldTimeOut(3000, &timer,true))
//    {
//        btn0->isPressed=!btn0->isPressed;
////        ldGuiJumpPage(1);
//    }

    if(xBtnGetState(KEY_NUM_LEFT,BTN_PRESS))
    {
        if(targetBtn==btn1)
        {
            btn0->isSelected=true;
            btn1->isSelected=false;
            targetBtn=btn0;
        }
        else
        {
            btn0->isSelected=false;
            btn1->isSelected=true;
            targetBtn=btn1;
        }
    }
    if(xBtnGetState(KEY_NUM_RIGHT,BTN_PRESS))
    {
        if(targetBtn==btn1)
        {
            btn0->isSelected=true;
            btn1->isSelected=false;
            targetBtn=btn0;
        }
        else
        {
            btn0->isSelected=false;
            btn1->isSelected=true;
            targetBtn=btn1;
        }
    }
}

void userLoop1(void)
{
    if( ldTimeOut(3000, &timer,true))
    {
        ldGuiJumpPage(0);
    }
}

void userQuit(void)
{
//        pImageDel(img);
    ldWindowDel(win0);
}

void userQuit1(void)
{
//        pImageDel(img);
    ldWindowDel(win1);
}

void (*ldUserPageInitFunc[LD_PAGE_MAX])(void)={userInit,userInit1};
void (*ldUserPageLoopFunc[LD_PAGE_MAX])(void)={userLoop,userLoop1};
void (*ldUserPageQuitFunc[LD_PAGE_MAX])(void)={userQuit,userQuit1};


